import React from "react";
import  Container from "@mui/material/Container";
import SendIcon from '@mui/icons-material/Send';
import {Input}  from '@mui/icons-material'
import TextField from '@mui/material/TextField';

import SearchResult from "../components/Modules/SearchResults";
import { Box } from "@mui/system";
import { useNavigate } from "react-router";
import { Typography } from "@mui/material";
function MainSearch(props){
   let navigation=useNavigate()
    return (
        <section>    
            <article>   
                <Typography> Animal Crossing Fishing Index</Typography>
                <Container>
                    <Box>    
                        <TextField sx={{width:'100%'}} id="outlined-search" label="Search field" placeholder='Search for fish here' required={true} onChange={(event)=>{props.object.handleSearchChange(event.target.value)}}/>
                        <SearchResult  result={props.object.state.searchResult}></SearchResult>
                    </Box>

                </Container>


            </article>
        </section>
    );

}
export default MainSearch;
